pub fn compute_siloed_hash(contract_address: Field, inner_note_hash: Field) -> Field {
    let inputs = [contract_address, inner_note_hash];
    pedersen_hash(inputs, GENERATOR_INDEX__SILOED_COMMITMENT)
}

