#[oracle(getPublicKeyAndPartialAddress)]
fn get_public_key_and_partial_address_oracle(_address: Field) -> [Field; 3] {}

unconstrained fn get_public_key_and_partial_address_internal(address: Field) -> [Field; 3] {
