struct SafeU120 {
    value: u120,
}

impl SafeU120 {
    pub fn min() -> Self {
        Self {
            value: 0
        }
    }

    pub fn max() -> Self {
        Self {
            value: 0xffffffffffffffffffffffffffffff
        }
    }

    pub fn new(
        value: Field,
    ) -> Self {
        // Check that it actually will fit. Spending a lot of constraints here :grimacing:
        let bytes = value.to_be_bytes(32);
        for i in 0..17 {
            assert(bytes[i] == 0, "Value too large for SafeU120");
        }
        Self {
            value: value as u120
        }
    }

    pub fn is_zero(
        self: Self,
    ) -> bool {
        self.value == 0
    }

    pub fn eq(
        self: Self,
        other: Self
    ) -> bool {
        self.value == other.value
    }

    pub fn lt(self: Self, other: Self) -> bool {
        self.value < other.value
    }

    pub fn le(self: Self, other: Self) -> bool {
        self.value <= other.value
    }

    pub fn gt(self: Self, other: Self) -> bool {
        self.value > other.value
    }

    pub fn ge(self: Self, other: Self) -> bool {
        self.value >= other.value
    }

    pub fn sub(
      self: Self,
      b: Self,
    ) -> Self {
        assert(self.value >= b.value, "Underflow");
        Self {
            value: self.value - b.value
        }
    }

    pub fn add(
        self: Self,
        b: Self,
    ) -> Self {
        let c: u120 = self.value + b.value;
        assert(c >= self.value, "Overflow");
        Self {
            value: c
        }
    }

    pub fn mul(
        self: Self,
        b: Self,
    ) -> Self {
        let c: u120 = self.value * b.value;
        if !b.is_zero() {
            assert(c / b.value == self.value, "Overflow");
        }
        Self {
            value: c
        }
    }

    pub fn div(
        self: Self,
        b: Self,
    ) -> Self {
        assert(!b.is_zero(), "Divide by zero");
        Self {
            value: self.value / b.value
        }
    }

    pub fn mul_div(
        self: Self,
        b: Self,
        divisor: Self
    ) -> Self {
        self.mul(b).div(divisor)
    }

    pub fn mul_div_up(
        self: Self,
        b: Self,
        divisor: Self
    ) -> Self {
        let c = self.mul(b);
        assert(!divisor.is_zero(), "Divide by zero");
        let adder = ((self.value * b.value % divisor.value) as u120 > 0) as u120;
        c.div(divisor).add(Self {value: adder})
    }

    // todo: implement mul_div with 240 bit intermediate values.
}

#[test]
fn test_init() {
    let a = SafeU120::new(1);
    assert(a.value == 1);
}

#[test]
fn test_init_max() {
    let a = SafeU120::max();
    assert(a.value == 0xffffffffffffffffffffffffffffff);
}

#[test]
fn test_init_min() {
    let a = SafeU120::min();
    assert(a.value == 0);
}

#[test]
fn test_is_zero() {
    let a = SafeU120::min();
    assert(a.value == 0);
    assert(a.is_zero() == true);
}

#[test]
fn test_eq() {
    let a = SafeU120::new(1);
    let b = SafeU120::new(1);
    assert(a.eq(b));
}

#[test]
fn test_lt() {
    let a = SafeU120::new(1);
    let b = SafeU120::new(2);
    assert(a.lt(b));
    assert(b.lt(a) == false);
}


#[test]
fn test_le() {
    let a = SafeU120::new(2);
    let b = SafeU120::new(2);
    let c = SafeU120::new(5);
    assert(a.le(b));
    assert(a.le(c));
    assert(c.le(a) == false);
}

#[test]
fn test_gt() {
    let a = SafeU120::new(1);
    let b = SafeU120::new(2);
    assert(b.gt(a));
    assert(a.gt(b) == false);
}


#[test]
fn test_ge() {
    let a = SafeU120::new(2);
    let b = SafeU120::new(2);
    let c = SafeU120::new(5);
    assert(a.ge(b));
    assert(a.ge(c) == false);
    assert(c.ge(a));
}

#[test(should_fail)]
