fn test_mul_div_up_non_rounding() {
    let a = SafeU120::new(6);
    let b = SafeU120::new(3);
    let c = SafeU120::new(2);
    let d = SafeU120::mul_div_up(a, b, c);
    assert(d.value == 9);
